%[text] %[text:anchor:H_75d1] ### Dataselect - Time Series Data
%[text] Time series data can be retrieved in three primary formats, reviewed below. These workflows save data from a FDSN URL on your local device. To build the appropriate URL, <u>**SAGE provides a URL builder:**</u> [<u>**https://service.earthscope.org/fdsnws/dataselect/docs/1/builder/**</u>](https://service.earthscope.org/fdsnws/dataselect/docs/1/builder/) 
%[text] When you've specified your parameters and generated the appropriate URL, substitute it into any of the below workflows as the dataURL.
url = "https://service.iris.edu/fdsnws/dataselect/1/query?sta=ANMO&cha=BHZ&starttime=2025-02-06T00:00:00&endtime=2025-02-06T02:00:00&format=mseed&nodata=404";

% % Uncomment the following lines if you're seeing an error with
% matlab.net:
% % Use matlab.net.http to inspect HTTP status
% import matlab.net.*
% import matlab.net.http.*

uri = URI(url);
req = RequestMessage;
resp = req.send(uri);

% Check HTTP status
if resp.StatusCode ~= 200
    error("HTTP request failed: %d %s", resp.StatusCode, char(resp.Status.ReasonPhrase));
end

% Get raw bytes (uint8)
raw = uint8(resp.Body.Data);         % ensure uint8

% Create a single filename (char)
tmp = char(tempname + ".mseed");     % tempname -> string concat -> char

% Write, checking fopen
[fid, msg] = fopen(tmp, 'w');
if fid == -1
    error("Failed to open temp file for writing: %s", msg);
end
count = fwrite(fid, raw, 'uint8');
fclose(fid);
fprintf("Wrote %d bytes to %s\n", count, tmp); %[output:3736e4b5]

% Verify file exists
if ~isfile(tmp)
    error("Temporary file not found after write: %s", tmp);
end

% Now call the reader (example: rdmseed). Convert to char again if required.
S = rdmseed(tmp);

% Clean up
delete(tmp);

%%
figure %[output:95dbfbc0]
plot(S(1).d) %[output:95dbfbc0]

% a second plot option
figure %[output:5fb2f39b]
tiledlayout(3,1) %[output:5fb2f39b]
nexttile %[output:5fb2f39b]
plot(S(1).d); %[output:5fb2f39b]
nexttile %[output:5fb2f39b]
plot(S(2).d) %[output:5fb2f39b]
nexttile %[output:5fb2f39b]
plot(S(3).d) %[output:5fb2f39b]

